		INSERT [dbo].[Template] ([IdTemplate], [Name], [IdUser], [Active], [HtmlCode], [IdTemplateCategory]) VALUES (24, N'Gettyimages', NULL, 1, N'<table cellpadding="0" cellspacing="0" width="100%" border="0"> <tr> <td align="center" valign="top" style="padding-bottom:20px; padding-top:20px;"> <table cellpadding="0" cellspacing="0" width="600" style="border:1px solid #FF00B0" align="center"> <tr> <td align="center" valign="top" style="padding-top:35px; padding-bottom:20px;"> <table cellpadding="0" cellspacing="0" width="560" border="0"> <tr> <td align="left" valign="top" style="line-height:0px;"><img src="logo.jpg" /></td> <td align="right" valign="top"><div class="editable"> <p style="font-family:Arial, Helvetica, sans-serif; font-size:18px; font-weight:bold; padding:0px; margin-bottom:0px; margin-top:0px; line-height:19px; color:#FF00B0">Información institucional</p></div></td> </tr> <tr> <td colspan="2" style="padding-top:20px; line-height:0px;"><img src="bordear.png" /></td> </tr> <tr> <td colspan="2" align="center" valign="top" bgcolor="#FF00B0"><div class="editable"><p style="font-family:Arial, Helvetica, sans-serif; font-size:18px; padding:0px; margin-bottom:0px; margin-top:0px; line-height:19px; color:#000000">Más de <b>8 millones de Imágenes</b> disponibles para sus proyectos</p></div></td> </tr> <tr> <td colspan="2" align="left" valign="top" style="line-height:0px; padding-bottom:20px;"><img src="bordeab.png" /></td> </tr> <tr> <td align="left" valign="top" colspan="2"><div class="groupWrapper"><div class="editor_textarea"> <table cellpadding="0" cellspacing="0" width="560" border="0"> <tr> <td align="left" valign="top" width="340"><p style="font-family:Arial, Helvetica, sans-serif; font-size:12px; color:#000; padding:0px; margin-bottom:0px; margin-top:0px; font-weight:bold; line-height:19px;">Flexibilidad</p> <p style="font-family:Arial, Helvetica, sans-serif; font-size:12px; color:#666; padding:0px; margin-bottom:0px; margin-top:0px; line-height:19px;">Tenemos planes a la medida de sus necesidades. Usted puede seleccionar la duración de la suscripción y la cantidad de imágenes a las que desea acceder diariamente utilizando la opción de pago que prefiera: mensual, pago adelantado, tarjetas de crédito.</p> </td> <td width="60"></td> <td width="15" bgcolor="#171717"></td> <td width="125" align="left" valign="top" bgcolor="#171717"> <p style="font-family:Arial, Helvetica, sans-serif; font-size:18px; line-height:20px; padding:0px; margin-bottom:0px; margin-top:0px; color:#FF00B0;">&nbsp;</p> <p style="font-family:Arial, Helvetica, sans-serif; font-size:18px; line-height:20px; padding:0px; margin-bottom:0px; margin-top:0px; color:#FF00B0;">Realice tareas<br /> de búsqueda y descarga con <br />solo <b>3 clics.</b></p> <p style="font-family:Arial, Helvetica, sans-serif; font-size:18px; line-height:20px; padding:0px; margin-bottom:0px; margin-top:0px; color:#FF00B0;">&nbsp;</p> </td> <td width="20" bgcolor="#171717"></td> </tr> </table> </div></div> </td> </tr> <tr> <td style="padding-top:20px; line-height:0px; padding-bottom:20px;" valign="top" align="left" colspan="2"><div class="groupWrapper"><div class="editor_textarea"><p style="padding:0px; margin:0px;"><img src="ima.png" /></p></div></div></td> </tr> <tr> <td align="center" valign="top" bgcolor="#D2D2D2" colspan="2"> <table cellpadding="0" cellspacing="0" width="520" border="0"> <tr> <td style="padding-top:20px;padding-bottom:15px;" align="left" valign="top"><div class="editable"><p style="font-family:Arial, Helvetica, sans-serif; padding:0px; margin-bottom:0px; margin-top:0px; font-size:12px; color:#666; line-height:14px;">También te ofrecemos servicios de producción fotográfica, organización de bancos de imágenes con Media Manager y difusión de tu información a los medios con <a style="color:#666; font-size:12px;">Image.net</a></p><p style="font-family:Arial, Helvetica, sans-serif; padding:0px; margin-bottom:0px; margin-top:0px; font-size:12px; color:#666;line-height:14px;">&nbsp;</p><p style="font-family:Arial, Helvetica, sans-serif; padding:0px; margin-bottom:0px; margin-top:0px; font-size:12px; color:#666;line-height:14px;">Además, accede a nuestras suscripciones y dale vida a tus proyectos con imágenes realizadas por los mejores fotógrafos de la argentina y el mundo.</p></div> </td> </tr> <tr> <td align="left" valign="top" style="padding-top:10px; padding-bottom:10px;" bgcolor="#FF00B0"> <div class="groupWrapper"><div class="editor_textarea"> <table cellpadding="0" cellspacing="0" width="520" border="0"> <tr> <td width="25"></td> <td align="left" valign="top" width="240"><p style="font-family:Arial, Helvetica, sans-serif; font-size:14px; color:#000; padding:0px; margin-bottom:0px; margin-top:0px; line-height:19px;"><a style="text-decoration:none; color:#000; font-weight:bold; font-size:14px;" href="mailto:argentina@gettyimageslatam.com">argentina@gettyimageslatam.com</a><br /><a style="text-decoration:none; color:#000; font-weight:bold; font-size:14px;" href="http://gettyimageslatam.com">gettyimageslatam.com</a></p></td> <td width="110"></td> <td width="145" align="left" valign="top"><p style="font-family:Arial, Helvetica, sans-serif; font-size:11px; color:#000; padding:0px; margin-bottom:0px; margin-top:0px; line-height:13px;">o telefónicamente al</p><p style="font-family:Arial, Helvetica, sans-serif; font-size:20px; color:#000; padding:0px; margin-bottom:0px; margin-top:0px; line-height:25px; font-weight:bold;">0800 333 0734</p></td> </tr> </table> </div></div> </td> </tr> <tr> <td style="padding-top:20px; padding-bottom:20px;" align="left" valign="top"> <table cellpadding="0" cellspacing="0" width="520"> <tr> <td align="left" valign="top"><div class="editable"><p style="font-family:Arial, Helvetica, sans-serif; font-size:11px; color:#666; padding:0px; margin-bottom:0px; margin-top:0px; line-height:14px;">Getty Images Argentina<br />Reconquista 950, 8° | 5246 9934 | Ciudad de Buenos Aires | Argentina</p></div></td> <td alig