	   SET IDENTITY_INSERT [dbo].[TemplateCategory] ON

       SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 1 
	   IF (@Item = 0)
	   BEGIN
	       	INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (1, N'Layouts', 1, 1)	
	   END
  
	    SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 2  
	    IF (@Item = 0)
		BEGIN
			INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (2, N'Holidays', 1, 2)	
	    END
		
		SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 3  
	    IF (@Item = 0)
		BEGIN
			INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (3, N'Industries', 1, 3)	
		END
 	    
		SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 4  
	    IF (@Item = 0)
		BEGIN
	 		INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (4, N'Promotions', 1, 4)	
		END
		
		SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 5  
	    IF (@Item = 0)
	    BEGIN 
			INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (5, N'Greetings', 1, 5)	
	    END
		
		SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 6  
	    IF (@Item = 0)
		BEGIN
		INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (6, N'eCommerce', 1, 6)	
		END
		
	    SELECT @Item = COUNT(*) from [dbo].[TemplateCategory] WHERE [IdtemplateCategory] = 7 
	    IF (@Item = 0)
		BEGIN
			INSERT [dbo].[TemplateCategory] ([IdTemplateCategory], [Name], [Active], [IdResource]) VALUES (7, N'Newsletter', 1, 7)	
		END

       SET IDENTITY_INSERT [dbo].[TemplateCategory] OFF
